import React from 'react';
import VideoPlayer from './components/VideoPlayer';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Video Player</h1>
      <VideoPlayer src="path/to/your/video.mp4" controls />
    </div>
  );
}

export default App;
